function buildTargetMessage(filename, dataUrl) {
  return {
    role: 'user',
    content: [
      {
        type: 'input_text',
        text:
          `TARGET. Filename: ${filename}\n` +
          'Extract model_code (모델코드) and asset_code (자산번호) as defined. Anchors may or may not be present—prefer printed label text when available; otherwise use patterns & layout. Ignore QR/barcodes. Return JSON only.',
      },
      { type: 'input_image', image_url: dataUrl },
    ],
  };
}

function normalizeFieldValue(value) {
  if (typeof value !== 'string') {
    return '';
  }
  return value.trim();
}

function describeField(fieldName, field) {
  const status = field?.status ?? 'unknown';
  const value = normalizeFieldValue(field?.value ?? '');
  return `${fieldName}=${value || '<empty>'} [status=${status}]`;
}

function arrayBufferToBase64(buffer) {
  const bytes = new Uint8Array(buffer);
  let result = '';
  const BASE64_ALPHABET = 'ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/';
  for (let i = 0; i < bytes.length; i += 3) {
    const triplet = (bytes[i] << 16) | ((bytes[i + 1] || 0) << 8) | (bytes[i + 2] || 0);
    result += BASE64_ALPHABET[(triplet >> 18) & 0x3f];
    result += BASE64_ALPHABET[(triplet >> 12) & 0x3f];
    result += i + 1 < bytes.length ? BASE64_ALPHABET[(triplet >> 6) & 0x3f] : '=';
    result += i + 2 < bytes.length ? BASE64_ALPHABET[triplet & 0x3f] : '=';
  }
  return result;
}

export async function runOcrFallback(imageBuffer, options = {}) {
  const apiKey = options.apiKey || (typeof process !== 'undefined' ? process.env.OPENAI_API_KEY : null);
  if (!apiKey) {
    throw new Error('OPENAI_API_KEY not set.');
  }
  const filename = options.filename || 'label.jpg';
  const mediaType =
    options.contentType && options.contentType.startsWith('image/') ? options.contentType : 'image/jpeg';
  const base64Payload = arrayBufferToBase64(imageBuffer);
  const dataUrl = `data:${mediaType};base64,${base64Payload}`;

  const payload = {
    model: 'gpt-5-mini',
    max_output_tokens: 1200,
    instructions: OCR_INSTRUCTIONS,
    text: {
      format: {
        type: 'json_schema',
        name: 'asset_label_extraction',
        schema: OCR_OUTPUT_SCHEMA,
        strict: true,
      },
      verbosity: 'medium',
    },
    input: [
      buildExampleMessage(),
      buildExampleAssistant(),
      buildExample2Message(),
      buildExample2Assistant(),
      buildTargetMessage(filename, dataUrl),
    ],
  };

  const response = await fetch('https://api.openai.com/v1/responses', {
    method: 'POST',
    headers: {
      Authorization: `Bearer ${apiKey}`,
      'Content-Type': 'application/json',
    },
    body: JSON.stringify(payload),
  });

  if (!response.ok) {
    const errorText = await safeReadText(response);
    const error = new Error(`OCR fallback request failed (${response.status}): ${errorText}`);
    try {
      error.cause = {
        status: response.status,
        headers: Object.fromEntries(response.headers?.entries?.() ?? []),
        body: errorText,
      };
    } catch {
      // ignore serialization issues
    }
    throw error;
  }

  const json = await response.json();

  function findTextEntry(payload) {
    const outputs = Array.isArray(payload?.output) ? payload.output : [];
    for (const entry of outputs) {
      const content = Array.isArray(entry?.content) ? entry.content : [];
      for (const item of content) {
        if (item?.type === 'output_text' && typeof item.text === 'string') {
          return item;
        }
      }
    }
    const singleContent = Array.isArray(payload?.output?.content) ? payload.output.content : [];
    for (const item of singleContent) {
      if (item?.type === 'output_text' && typeof item.text === 'string') {
        return item;
      }
    }
    return null;
  }

  const textEntry = findTextEntry(json);
  if (!textEntry?.text) {
    const error = new Error('OCR fallback did not return text output.');
    try {
      error.cause = {
        status: response.status,
        headers: Object.fromEntries(response.headers?.entries?.() ?? []),
        json,
      };
    } catch {
      // ignore serialization issues
    }
    throw error;
  }

  let parsed;
  try {
    parsed = JSON.parse(textEntry.text);
  } catch (error) {
    throw new Error('OCR fallback returned malformed JSON.');
  }

  const fields = parsed?.fields ?? {};
  const modelField = fields.model_code ?? {};
  const assetField = fields.asset_code ?? {};
  const modelValue = normalizeFieldValue(modelField.value).toUpperCase();
  const assetValue = normalizeFieldValue(assetField.value).toUpperCase();

  // asset_code is mandatory; model_code is optional
  const assetOk = /^[A-Z]{3}\d{4,5}$/.test(assetValue);
  if (!assetValue || !assetOk) {
    const parts = [describeField('asset_code', assetField)];
    if (Array.isArray(parsed?.errors) && parsed.errors.length > 0) {
      parts.push(`errors=${parsed.errors.join('; ')}`);
    }
    throw new Error(`OCR fallback could not extract a valid asset_code (${parts.join(' | ')}).`);
  }

  return {
    modelCode: modelValue || null,
    assetTag: assetValue,
    rawCombined: [modelValue, assetValue].filter(Boolean).join(' ').trim(),
    structured: parsed,
  };
}

async function safeReadText(response) {
  try {
    return await response.text();
  } catch (error) {
    return '[unreadable response body]';
  }
}

export function hasOcrSupport(env) {
  return Boolean(env?.OPENAI_API_KEY);
}
